import { useState } from "react";

function TodoList() {
    const [value,setValue] = useState("");
    const onChange = (event:React.FormEvent<HTMLInputElement>) => {
        const {
            currentTarget: {value},
        } = event;
    };
    return (
        <div>
            <form>
                <input onChange={onChange} value={value} placeholder="write todo" />
                <button>ADD</button>
            </form>
        </div>
    );
};

export default TodoList;
